import React from 'react';
import '../css/BarraNav.css'
import { Link } from 'react-router-dom';
import { Nav } from 'react-bootstrap';

function BarraNav(){
    return(
        <div>
           <nav>
            <ul>
                <Nav.Link  as={Link} to='/' class='li'>Home</Nav.Link>
                <Nav.Link as={Link} to='/registro' class='li'>Registro</Nav.Link>
                <Nav.Link as={Link} to='/login' class='li'>Login</Nav.Link>


               
            </ul>
        </nav>
        </div>
    );
}
export default BarraNav;
